import { Link } from 'react-router-dom';

const LandingPage = () => (
    <div className="landing-page">
        <h1>Houseplant Haven</h1>
        <p>Discover the perfect plants to brighten your home!</p>
        <Link to="/products">
            <button>Get Started</button>
        </Link>
    </div>
);

export default LandingPage;
